import React from "react";
import styled from "styled-components";

const ItemContainer = styled.div`
    display: flex;
    flex-wrap: wrap;
`;

const Item = props => {
  return (
    <ItemContainer >
        <img />
        <h1>{this.props.name}</h1>
        <h2>{this.props.price}</h2>
    </ItemContainer>
  );
};

export default Item;
